After building the first row of the CYK table, we see  
  position 1: t0  ⇒ {NT26}  
  position 2: t15 ⇒ {NT24, NT29}  

To fill the cell spanning tokens 1–2, we look for any rule A→B C with B∈{NT26} and C∈{NT24, NT29}.  Scanning all binary rules, none has (B,C)=(NT26,NT24) or (NT26,NT29).  Hence that cell is empty, and the whole CYK table fails—S cannot derive the string.  

